ead_time_notes_01:"最短当日の受け取りができます。",text_store_inventory_purchase_quantity_restriction_notes_01:"ORDER & PICKは1点のみの購入となります。数量を1に変更してください。",text_store_inventory_purchase_alteration_restriction_notes_01:"ORDER & PICKでは補正を承ることができません。適用した補正を解除してください。",text_store_inventory_purchase_restriction_title:"ORDER & PICKについて",text_store_inventory_purchase_restriction_instruction_01:"2点以上の数量、または補正が選択されています。ORDER & PICKでは、2点以上の購入及び補正を承ることができません。",text_store_inventory_purchase_restriction_instruction_02:"内容を変更し、ORDER & PICKを再度行なってください。",text_store_inventory_purchase_require_login:"購入手続きには会員登録が必要です。すでにユニクロ・ジーユー会員の方はログインしてください。",text_store_inventory_purchase_information_title:"ORDER & PICKについて",text_store_inventory_purchase_information_description_01:"クレジットカードでのお支払いとなります。",text_store_inventory_purchase_information_description_02:"指定店舗での準備が出来次第、お客様にメールを差し上げます。",text_store_inventory_purchase_information_description_03:"店舗受取りでのお渡しとなります。",text_store_inventory_purhcase_payment_method_notes_01:"お支払いはクレジットカードのみとなります。ご注文完了後店舗で在庫を確認し、商品のご用意ができ次第メールでお知らせいたします。",text_register_billing_address_button_label:"次へ",text_store_inventory_purchase_title:"ORDER & PICK",text_submit_registered_credit_card:"次へ",text_continue_to_register_new_credit_card:"次へ",text_items_in_online_store_cart_description_01:"カート内にまだ購入手続きが完了していない商品があります。続けて購入しますか？",text_store_inventory_purchase_estimated_pickup_date:"最短受取り可能日",text_store_inventory_purchase_estimated_pickup_date_notes_01:"商品のご用意ができ次第、メールにてご連絡します。",text_return_to_registered_credit_card_list:"一覧へ戻る",text_store_inventory_purchase_order_complete_message_01:"商品のご用意ができ次第、メールでお知らせいたします。",text_store_inventory_purchase_order_complete_message_02:"なお、ご指定店舗の在庫状況により商品が揃わない場合、ご注文をお受けできずキャンセルとなります。あらかじめご了承ください。 ※在庫状況により、登録のお電話番号に店舗よりご連絡を差し上げる場合がございます。",text_select_return_reason:"返品理由を選択してください。",text_select_check_box_required:"",text_product_return_pickup_notes_01:"",text_thank_you_for_shopping_with_uq:"",text_error_tax_calculation_failed_message_01:"",text_error_tax_calculation